import React from 'react'
import { ClientCardData } from './RouteListFolder/clientCardData'

export const CompletedRutesComponent = ({ rutesCompleted }) => {

    return (
        <>
            <section className = 'RutesListContainer'>
    
              { rutesCompleted.map( (e)=>
              
                <div key = { e.directionRute } className='clientCard'>
    
                  <ClientCardData clientData = { e }/>
    
                </div>
              
              ) }
    
            </section>
        </>
    )    
}
